    fun interpolate(table: FloatArray, index: Float, size: Float): Float {
        val scaledIndex = index * size
        val intIndex = scaledIndex.toInt()
        
        // Safety check for indices
        if (intIndex >= table.size - 1) return table[table.size - 1]
        if (intIndex < 0) return table[0]
        
        val frac = scaledIndex - intIndex
        val a = table[intIndex]
        val b = table[intIndex + 1]
        return a + (b - a) * frac
    }

